import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
@Component({
  selector: 'app-result',
  templateUrl: './result.component.html',
  styleUrls: ['./result.component.css']
})
export class ResultComponent implements OnInit {
  resultData: any;

  constructor(private route: ActivatedRoute) {}

  ngOnInit() {
    this.resultData = this.route.snapshot.data;

    // Check if you receive the data properly
    console.log('Result Data:', this.resultData.value);
  }
}
<div>
  <h2>Result Page</h2>
  <p>Text: {{ resultData['@text'] }}</p>
  <p>Confidence: {{ resultData['@confidence'] }}</p>
  <!-- Display other relevant fields as needed -->

  <div *ngIf="resultData.Resources && resultData.Resources.length > 0">
    <h3>Resources</h3>
    <ul>
      <li *ngFor="let resource of resultData.Resources">
        URI: {{ resource['@URI'] }} | Support: {{ resource['@support'] }} | Types: {{ resource['@types'] }}
        <!-- Display other resource properties as needed -->
      </li>
    </ul>
  </div>
</div>
